"original": |2-
     A Transport Protocol specification consists of a transport protocol
     identifier, representing some combination of transport protocols, and
     any number of transport header parameters required or optional to use
     with the identified protocol specification.  This registry contains
     the identifiers used by registered transport protocol identifiers.
"fixed": |-
  A Transport Protocol specification consists of a transport protocol identifier, representing some combination of transport protocols, and any number of transport header parameters required or optional to use with the identified protocol specification.  This registry contains the identifiers used by registered transport protocol identifiers.
"ko": |-
  전송 프로토콜 사양은 전송 프로토콜의 일부 조합을 나타내는 전송 프로토콜 식별자와 식별된 프로토콜 사양과 함께 사용하는 데 필요하거나 선택적인 전송 헤더 매개변수로 구성됩니다. 이 레지스트리에는 등록된 전송 프로토콜 식별자에 사용되는 식별자가 포함되어 있습니다.
